  CONSTRAINT `PETS_fk2` FOREIGN KEY (`owner_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `arc_pet` CHECK (((`shelter_id` is null) or (`owner_id` is null)))
